import React from 'react'
import styled from 'styled-components'
import { NavLink } from 'react-router-dom'

import house from '../Images/house.png'
import sffbhackathon from '../Images/sffbhackathon.png'

const Hackathons: React.FC = () => {

    return (
        <StyledContainer>
            <StyledSectionsHolder>
                <StyledSections to='/' exact><img width="30px" height="30px" src={house} alt='house to show that this is a button to home' /></StyledSections>
            </StyledSectionsHolder>
            <StyledHeader>Hackathons</StyledHeader>
            <StyledRow>
            <StyledColumn></StyledColumn>
            <StyledImage src={sffbhackathon} />
            <StyledColumn>
            I attended this hackathon from 
            </StyledColumn>
            </StyledRow>
        </StyledContainer>
    )
}
const StyledHeader = styled.h3`
text-align: center;
`
const StyledRow = styled.div`
display: flex;
flex-direction: row;
`
const StyledColumn = styled.div`
display: flex;
flex-direction: column;
`
const StyledImage = styled.img`
width: 30%;
`
const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
max-height: 90%;
overflow-y: scroll;
height: 90%;
background-color: #006464;
`
const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`
const StyledSectionsHolder = styled.nav`
@media (min-width: 900px){
        position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    height: 5%;
    width: 5%;
    display: flex;
        left: 3%;
    }
    @media (max-width: 900px){
        position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    height: 5%;
    width: 5%;
    display: flex;
        left: 2%;
    }
`


export default Hackathons;
